methods.description:
Evaluates an expression and returns the result as a string.

### Example
The client sends:
```
{
    "handle": 1,
    "method": "Evaluate",
    "params": {
        "qExpression": "Sum(Holes)"
    },
    "id": 6,
    "jsonrpc": "2.0"
}
```
The engine returns:
```
{
    "jsonrpc": "2.0",
    "id": 6,
    "result": {
        "qReturn": "361716"
    }
}
```

